import React from "react";

export default function Fetchv(){

    const kk = async (e) => {
        e.preventDefault();
        const res = await fetch('https://randomuser.me/api/')
        const data = await res.json()
        console.log(data)
    }

    return(
    <>
    <div>
        <button class="btn btn-primary btn-lg" onClick={kk}></button>
        <p>
            {data}
        </p>
    </div>
    </>)
}
